backends:
- group: google-service-user-v1
  url_pattern: /v1/services:search
  method: GET
  host:
  - https://serviceuser.googleapis.com
  query_string_params:
  - pageSize
  - pageToken
  whitelist:
  - nextPageToken
  - services
  concurrent_calls: 1
  extra_config:
    provider: googleapis.com
    description: Enables services that service consumers want to use on Google Cloud
      Platform, lists the available or enabled services, or disables services that
      service consumers no longer use.
    version: v1
    slug: google-service-user-v1-v1-services-search
    mapping:
      nextPageToken: nextPageToken
      services: services
    hosts:
    - https://serviceuser.googleapis.com
    schemes:
    - https
